def escape_regex(text):
    return re.escape(text)

def parsing_with_presufix(text, start, end):
    results = re.findall(f'({escape_regex(start)}.*?{escape_regex(end)})', text)
    return results

def parsing_without_presufix(text, start, end):
    results = re.findall(f'{escape_regex(start)}(.*?){escape_regex(end)}', text)
    return results

